import React from 'react';
import PropTypes from 'prop-types';
import useMediaQuery from '@material-ui/core/useMediaQuery';
import { useTheme } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Hidden from '@material-ui/core/Hidden';
import Grid from '@material-ui/core/Grid';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import SideNavigation from '../SideNavigation';
import brand from '~/public/text/brand';
import { withTranslation } from '~/i18n';
import { useText } from '~/theme/common';
import Settings from '../Settings';
import useStyles from './banner-style';

function BannerNav(props) {
  const theme = useTheme();
  const text = useText();
  const classes = useStyles();
  const isDesktop = useMediaQuery(theme.breakpoints.up('lg'));
  const { t } = props;
  const {
    onToggleDark,
    onToggleDir,
  } = props;

  return (
    <div className={classes.root}>
      <Container fixed={isDesktop}>
        <Grid container spacing={0}>
          <Grid item lg={2} xs={12}>
            <Hidden mdDown>
              <SideNavigation />
            </Hidden>
          </Grid>
          <Grid item lg={10} xs={12}>
            <div className={classes.banner}>
              <div className={classes.cover}>
                <div className={classes.figure}>
                  <img src={brand.profile.cover} alt="cover" />
                  <div className={classes.overlay} />
                </div>
              </div>
              {/* <Hidden mdDown>
                <div className={classes.settingIcon}>
                  <Settings toggleDark={onToggleDark} toggleDir={onToggleDir} />
                </div>
              </Hidden> */}
              <div className={classes.text}>
                <Typography variant="h4" className={text.title2}>
                </Typography>
                <Typography variant="h6" className={text.subtitle2}>
                Hi, I'm Natalia Sergeeva,
                </Typography>
                <Typography variant="h4" className={text.title2}>
                Front End Developer & Designer
                </Typography>
                <Hidden smDown>
                  <Typography variant="h5" className={text.subtitle2}>
                    {t('common:profile-landing.banner_desc')}
                  </Typography>
                  <div className={classes.socmed}>
                    <IconButton aria-label="Delete" className={classes.margin} size="small">
                      <i className="ion-social-facebook" />
                    </IconButton>
                    <IconButton aria-label="Delete" className={classes.margin} size="small">
                      <i className="ion-social-twitter" />
                    </IconButton>
                    <IconButton aria-label="Delete" className={classes.margin} size="small">
                      <i className="ion-social-instagram" />
                    </IconButton>
                    <IconButton aria-label="Delete" className={classes.margin} size="small">
                      <i className="ion-social-linkedin" />
                    </IconButton>
                  </div>
                </Hidden>
              </div>
            </div>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}

BannerNav.propTypes = {
  onToggleDark: PropTypes.func.isRequired,
  onToggleDir: PropTypes.func.isRequired,
  t: PropTypes.func.isRequired
};

export default withTranslation(['profile-landing'])(BannerNav);
